import React from "react";

function Projects() {
  return (
    <section id="projects">
      <h2>Projects</h2>
      <div className="project-cards">
        <div className="project-card">
          <h3>Project 1</h3>
          <p>간단한 설명</p>
        </div>
        <div className="project-card">
          <h3>Project 2</h3>
          <p>간단한 설명</p>
        </div>
        <div className="project-card">
          <h3>Project 3</h3>
          <p>간단한 설명</p>
        </div>
      </div>
    </section>
  );
}

export default Projects;
